const Fetchtoken=(username, password)=>{
    const data={username:username, password:password};
    const api="http://localhost:5000/api/login";
    fetch(api,{
        method: 'POST',
        body:JSON.stringify(data),
        headers: new Headers({
            'Content-Type': 'application/json'
    })})
}

export default Fetchtoken;
